// import logo from "./logo.svg";
import "./App.css";
import HomePage from "./SitePages/homePage";
import NavBar from "./UIComponents/navBar";

function App() {
  let Component;
  switch (window.location.pathname) {
    case "/":
      Component = App;
      break;
    case "/compsci":
      Component = CompSci;
      break;
    case "/photovideo":
      Component = PhotoVideo;
      break;
    case "/aboutme":
      Component = AboutMe;
      break;
  }
  return (
    <div>
      <NavBar />
      <HomePage />
    </div>
  );
}

export default App;
